import React from 'react';
import './MainPage.css';

function MainPage() {
  const isLoggedIn = !!localStorage.getItem('isLoggedIn');

  const handleLogout = () => {
    localStorage.removeItem('isLoggedIn');
    window.location.href = '/';
  };

  return (
    <div className="main-page">
      <header className="main-header">
        <nav className="main-nav">
          <ul>
            <li><a href="/">Dashboard</a></li>
            <li><a href="/map">Map View</a></li>
            <li><a href="/profile">My Profile</a></li>
          </ul>
        </nav>
        <div className="login-section">
          {isLoggedIn ? (
            <button onClick={handleLogout}>Log out</button>
          ) : (
            <>
              <button className="login-btn"><a href="/login" className='without-underline'>Log in</a></button>
              <button className="register-btn"><a href="/register" className='without-underline'>Register</a></button>
            </>
          )}
        </div>
      </header>

      <section className="driver-info">
        <div className="welcome-text">
          <h1>Добро пожаловать, Водитель!</h1>
          <p>Тут ви можете переглядати та управляти вашими поїздками, відслідковувати доходи та переглядати запити на нові поїздки. Використовуйте наш інструментарій для покращення вашого досвіду як водія таксі.</p>
        </div>
        <div className="performance-dashboard">
          <div className="stats">
            <p><strong>Сьогоднішні поїздки:</strong> 5</p>
            <p><strong>Середній рейтинг:</strong> 4.8</p>
            <p><strong>Загальний дохід:</strong> 1200 грн</p>
          </div>
          <div className="alerts">
            <h3>Оповіщення</h3>
            <p>Ви маєте нову поїздку заплановану на 14:30.</p>
          </div>
        </div>
      </section>

      <footer className="main-footer">
        <p>© 2024 Driver Platform. Усі права захищені.</p>
      </footer>
    </div>
  );
}

export default MainPage;
